import React from 'react';
import './Square.css';

const Square = ({ height, width, color }) => {
  const rgbColor = `rgb(${color.r}, ${color.g}, ${color.b})`;

  return <div className="square" style={{ 
    height: `${height}px`,
    width: `${width}px`,
    background: rgbColor }}></div>;
};

export default Square;
